export const NotFound = () => {
  const classes = {
    notFoundMessage: '',
    numberMessage: '',
    textMessage: '',
  }
  return (
    <main className={classes.notFoundMessage}>
      <p className={classes.numberMessage}>Error: 404</p>
      <p className={classes.textMessage}>Page not found</p>
    </main>
  )
}
